module.exports = "<div class=\"container\">\n  <br>\n  <h4>Contact Us</h4>\n  <hr>\n  <h4>\n    What can we help you with?\n  </h4>\n  <p>\n    Whether it is a testimonial to our web site or requesting a piece of information or logging a complaint, we are always here to listen to you.\n  </p>\n  <p>\n    Before you contact us, please refer our <a routerLink=\"/faq\">FAQ's</a> for a possible answer to your question. If you still have a question, please contact us using one of the methods given below.\n  </p>\n  <br>\n  <h4>Send Us an Email</h4>\n  <br>\n  <div class=\"row\">\n    <div class=\"col-lg-5 col-md-5 col-sm-12\">\n      <div class=\"panel panel-default\">\n        <div class=\"panel-body\">\n          <form [formGroup]=\"contactForm\">\n            <div class=\"form-group\">\n              <label>Your Email Address</label>\n              <input type=\"email\" class=\"form-control\" autocomplete=\"false\" name=\"email\" formControlName=\"email\">\n            </div>\n            <div class=\"form-group\">\n              <label for=\"\">Contact Reason</label>\n              <textarea name=\"description\" rows=\"3\" class=\"form-control\"></textarea>\n            </div>\n            <div class=\"form-group\">\n              <button type=\"submit\" class=\"btn btn-primary btn-md\">Submit</button>\n              <button type=\"reset\" class=\"btn btn-default btn-md\">Reset</button>\n            </div>\n          </form>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-lg-5 col-md-5 col-sm-12\">\n      <h4>Pick-Up the Phone and Call Us</h4>\n\n      <p>0471-406-1965 (Office)</p>\n      <p>97-44-26-19-65 (Mobile)</p>\n      <br>\n      <h4>Visit or Write to Us</h4>\n      <div>\n        LetUsRead.in<br>\n        TC 25/2803(4), 'Pahima', Second Gate<br>\n        Uppalam Road<br>\n        Thiruvananthapuram<br>\n        Kerala - 695001<br>\n        India<br>\n      </div>\n    </div>\n  </div>\n</div>\n"

