module.exports = "<div class=\"container\">\n  <br>\n  <div class=\"row\" *ngIf=\"books.length\">\n    <div class=\"col-lg-8\">\n      <div class=\"panel panel-default\">\n        <div class=\"panel-title text-uppercase\">\n          <h5><b>My cart ({{ books.length }})</b></h5>\n        </div>\n        <hr>\n        <div class=\"panel-body\">\n          <div class=\"row book-items\" *ngFor=\"let book of books\">\n            <div class=\"col-lg-2\">\n              <div class=\"thumbnail\">\n                <img src=\"{{ book.image_thumbnail }}\" alt=\"{{ book.book_title }}\">\n              </div>\n            </div>\n            <div class=\"col-lg-7 col-md-7\">\n              <h5><b>{{ book.book_title }}</b></h5>\n              <h6>{{ book.book_authors }}</h6>\n              <h6>Publisher: {{ book.publisher }}</h6>\n              <h4><b>₹ {{ book.book_price }}</b></h4>\n            </div>\n            <div class=\"col-lg-3 col-md-3\">\n              <button class=\"btn btn-xs btn-default\" (click)=\"removeFromCart(book._id)\">Remove</button>\n              <h6>Requested for <b>{{ book['book_type'] }}</b></h6>\n            </div>\n          </div>\n        </div>\n        <div class=\"panel-footer text-right\">\n          <a routerLink=\"/checkout\" class=\"btn btn-md book-details-checkout btn-primary\">Checkout Books</a>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-lg-4 col-md-4\">\n      <div class=\"panel panel-default\">\n        <div class=\"panel-body\">\n          <h5 class=\"text-uppercase\"><b>Reading Fee</b></h5>\n          <hr>\n          <h5>\n            Price ({{ books.length }} items)\n            <span class=\"pull-right\"><b>₹ {{ totalPrice }}</b></span>\n          </h5>\n          <h5>\n            Delivery charges\n            <span class=\"pull-right\"><b>₹ {{ appConstants.del_charges }}</b></span>\n          </h5>\n          <hr>\n          <h5>\n            Amount payable\n            <span class=\"pull-right\"><b>₹ {{ totalPrice + appConstants.del_charges }}</b></span>\n          </h5>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class=\"row\" *ngIf=\"!books.length\">\n    <div class=\"col-lg-12\">\n      <div class=\"panel panel-default\">\n        <div class=\"panel-body text-center no-books\">\n          <div>\n            <i class=\"fa fa-smile-o\"></i>\n          </div>\n          <h3>No items added to cart!</h3>\n          <a routerLink=\"/welcome\">Continue shopping!</a>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n"

