module.exports = "<div class=\"container\">\n  <br>\n  <h4>\n    Quick Start\n  </h4>\n  <hr>\n  <h5>Steps</h5>\n  <p>The following simple step by step instructions to borrow read and return materials will help you get started with LetUsRead.</p>\n  <ul>\n    <li>\n      Sign up to become LetUsRead member using a valid Email Id.\n    </li>\n    <li>Add your address using the link 'My Addresses'.</li>\n    <li>Update your profile using the link 'My Profile'.</li>\n    <li>Search for publications and 'Check Out Now!'.</li>\n    <li>When publications are checked out, it’s reading fee is charged to your membership account.</li>\n    <li>Checked out publications will be delivered to you. You can pay the security deposit and the reading\n      fee at the time we deliver the books to you.</li>\n    <li>...</li>\n    <li>Once you done reading, go to 'My Checked Out Materials' and mark the materials as done reading. We will\n      come and collect the material from your address.</li>\n  </ul>\n  <br>\n  <h5>\n    Borrowing publications from our library is as simple as A, B, C!\n  </h5>\n  <p>\n    You do not have to use our web site to read our books, instead give us a call at 0471-247-4115 or 97-44-26-19-65 and request a book and get it delivered to your home or office!\n  </p>\n  <p>\n    Using LetUsRead, you can read and return what you want to read and when you want to read without ever having to leave the comforts of your home. We made it that easy for you.\n  </p>\n  <h5 class=\"remember\">\n    Remember, you can borrow any book that is available in the Indian market from us! If we do not have the book you want to borrow, all you have to do is to let us know. We will add the book to our collection within a few days and you can borrow it as soon as we have a copy of it. What more you can expect from a lending library?\n  </h5>\n  <p>\n    You can also explore all the exciting and useful features of LetUsRead such as sharing of your personal collection of books with the library, buying second hand books, referring your friends, gift memberships, book reviews, request books and many more!\n  </p>\n  <br>\n  <h5>\n    Join today with hundreds of our members who are enjoying our books and services!\n  </h5>\n  <br><br>\n  <h5 class=\"text-center\">Questions?</h5>\n  <br>\n  <div class=\"row\">\n    <div class=\"col-lg-4 questions\">\n      <h5>\n        How do I pay my membership dues?\n      </h5>\n      <p>You can pay your membership dues at the time your checked out materials are delivered to you. You can also pay your dues using\n        credit/debit cards from your membership page using the link 'Credit My Account'.</p>\n    </div>\n    <div class=\"col-lg-4 questions\">\n      <h5>\n        Once I'm done reading the materials, how do I return them?\n      </h5>\n      <p>You can either drop-off the material at the library or say that you are done with reading at your 'My Checked Out Materials'\n        page in which case we will come and collect your materials from your address.</p>\n    </div>\n    <div class=\"col-lg-4 questions\">\n      <h5>\n        Can I call the library for any service I need?\n      </h5>\n      <p>Of course! You never have to use our web site if you don't want to but still can read our books! Call the library for any service\n        from setting up the membership to checking out publications and returning them.</p>\n    </div>\n  </div>\n</div>\n"

