module.exports = "<div class=\"container\">\n  <br>\n  <div>\n    <div style=\"margin-top: 0px\" id=\"reading-scheme-heading-div\">\n      <div style=\"overflow: hidden\">\n        <div id=\"heading-text\">\n          <h4 style=\"margin-top: 0px; line-height: 1.2;\">\n            Library Reading Schemes</h4>\n        </div>\n      </div>\n      <div id=\"head-line\">\n      </div>\n    </div>\n    <!--#reading-scheme-heading-div -->\n    <div id=\"reading-scheme-content-div\">\n      <p style=\"margin-top: 0px\" id=\"font-10\">\n        Reading schemes has three parts - Security Deposit, Reading Fees and Reading Plans.</p>\n      <div>\n        <h5>\n          Security Deposit</h5>\n        <p style=\"line-height: 12.2pt;\">\n          Minimum security deposit is 500 rupees for 14-day plan and 1000 rupees for monthly plan.\n          <br>\n          <br>\n          Your security deposit determines how many books you can take at a time.\n          <br>\n        </p>\n\n      </div>\n      <div>\n        <h5>\n          Reading Fees</h5>\n        <p style=\"line-height: 12.2pt;\">\n          12% of the price of the book is charged as reading fee.\n          <br>\n        </p>\n\n      </div>\n      <!--#reading-scheme-subheading -->\n      <div>\n        <h5>\n          Reading Plans</h5>\n        <p style=\"line-height: 12.2pt;\">\n          Your reading plan determines the way by which you pay your reading fees.\n          <br>\n          <br>\n          There are two kinds of reading plans.\n\n        </p>\n\n        <span style=\"font-weight: bold;color: black;font-family: Verdana,Geneva,sans-serif;font-size: 10pt;\">1) Pay-on-time </span>\n\n        <ul id=\"PayOnTime\">\n          <li>You are charged reading fee at the time you check out books.</li>\n\n          <li>You can keep the publication as long as no other members is requesting that book.</li>\n\n          <li>You will be given 10 days to return the book if another member is waiting for the book.</li>\n          <li>If you need more time to finish the book, you can renew the book and keep it again for 14 days.</li>\n\n          <li>If you are an occasional reader, we recommend pay-on-time plan.</li>\n        </ul>\n        <br>\n        <span style=\"font-weight: bold;color: black;font-family: Verdana,Geneva,sans-serif;font-size: 10pt;\"> 2) Pay-in-advance </span>\n        <ul id=\"PayInAdvance\">\n          <li>As long as you are reading, pay 200 rupees as advance reading fee every month. This amount is kept in an account called plan.</li>\n          <li>Reading fee of the books you check out is deducted from this plan account.</li>\n          <li>Reading fee is charged only once per book no matter how long you keep the books.</li>\n          <li>There is no late fee in this plan and you are allowed to keep our publications as long as you want.</li>\n          <li>You can take a break from reading at any time and your plan balance remains in your account for you to use whenever you start reading again.</li>\n          <li>If you are a regular and or slow reader, we recommend pay-in-advance plan.</li>\n\n\n        </ul></div>\n      <!--#reading-scheme-subheading -->\n      <!--#our recommendation -->\n      <div>\n        <h5>\n          Our Recommendation\n        </h5>\n        <p style=\"line-height: 12.2pt;\">\n          Go with one-month pay-in-advance plan. Check out\n          books that you need for 30 days and have them delivered free to your address or you\n          come to the library to pick them up. When you are done reading, order for next set\n          of books while returning the old set. Since pay-in-advance plan has no due dates\n          or late fees you can read your books at your leisure.\n          <br>\n          <br>\n          Want to know more about this economical and popular plan? Give us a call!\n          <br>\n        </p>\n      </div>\n      <!--#our recommendation -->\n      <h5 style=\"color: #458B00; font-size: 12pt; font-weight: bold\">\n        Remember, you can borrow any book that is available in the Indian market from us!\n        If we do not have the book that you want to borrow, let\n        us know. We will add the book to our collection and you can borrow\n        it as soon as we have it. What more you can expect from a lending library?</h5>\n      <br>\n      <p style=\"line-height: 12.2pt;\">\n        Increase your security deposit at any time if you want to check out more publications.\n        <br>\n        <br>\n        You need to pay your account due only at the time we deliver books to your address.\n        <br>\n        <br>\n        So what are you waiting for? Join now and start reading.\n      </p>\n      <br>\n      <h4>Happy Reading!</h4>\n      <br><br>\n      <h5 class=\"text-center\">Questions?</h5>\n      <br>\n      <div class=\"row\">\n        <div class=\"col-lg-4 questions\">\n          <h5>\n            How do I pay my membership dues?\n          </h5>\n          <p>You can pay your membership dues at the time your checked out materials are delivered to you. You can also pay your dues using\n            credit/debit cards from your membership page using the link 'Credit My Account'.</p>\n        </div>\n        <div class=\"col-lg-4 questions\">\n          <h5>\n            Once I'm done reading the materials, how do I return them?\n          </h5>\n          <p>You can either drop-off the material at the library or say that you are done with reading at your 'My Checked Out Materials'\n            page in which case we will come and collect your materials from your address.</p>\n        </div>\n        <div class=\"col-lg-4 questions\">\n          <h5>\n            Can I call the library for any service I need?\n          </h5>\n          <p>Of course! You never have to use our web site if you don't want to but still can read our books! Call the library for any service\n            from setting up the membership to checking out publications and returning them.</p>\n        </div>\n      </div>\n    </div>\n    <!--#reading-scheme-subheading -->\n  </div>\n</div>\n"

